import React from 'react';
import'tachyons';
import './FaceRecognition.css';
const FaceRecognition = ({imageUrl}) => {
	return(
		<div className='center'>
			<img src={imageUrl} alt='Can not load image!'/>
		</div>
		);
}
export default FaceRecognition;
